import{Buildable}from"../../interface/buildable.min.js";import{DevelopmentToolHelpModel}from"../../model/help/development-tool-help-model.min.js";import{Utility}from"../../shared/utility.min.js";import{PageColorAdjuster}from"../../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";import StylesheetSeriesLoader from"../../shared/stylesheet-series-loader.min.js";class DevelopmentToolHelpController extends Buildable{constructor(){super(),this.model=new DevelopmentToolHelpModel,this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/work-experience.min.css"),this.stylesheetLoader.load(),this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new DevelopmentToolHelpController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=async()=>{const e=this.model.getDevelopmentTools();for(let t=0;t<e.length;t++){const o=e[t],r=[];r.push(this.createNoTd(t)),r.push(this.createNameTd(o)),r.push(this.createDescriptionTd(o));const s=`<tr>${r.join("")}</tr>`;$("#help-info tr:last").after(s)}(await PageColorAdjuster.build()).changeBackgroundColor(),$("body").addClass("loaded")};createTd=e=>`<td class='help-info-cell'>${e}</td>`;createNoTd=e=>{const t=e+1;return this.createTd(`<p style='text-align:center;'>${t}</p>`)};createNameTd=e=>this.createTd(`<p class="work-experience-technology-development-tool" style="white-space:nowrap;">${e.name}</p>`);createDescriptionTd=e=>this.createTd(`<p>${e.description}</p>`);changeBackgroundColor=()=>{const e=new SeasonReminder;e.seasonInfluence=10;const t=Array.from(document.getElementsByClassName("preloader-section"));e.remindAll("background-color",t)}}export{DevelopmentToolHelpController};